    &amp;Ucirc;&amp;Ucirc;   In this verite documentary the family of Hong Sun Hui, a        &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   female worker in a textile factory, takes us through an         &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   ordinary day in the country of the Beloved Leader Kim Jong Il.  &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   The people undergo an endless stream of propaganda. Unmoved,    &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   they perform their duties. At the nursery school, Hong's        &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   daughter learns that 'flowers need the sun and she needs the    &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   love of the Great Leader to grow.' The system of                &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   indoctrination, control and self-criticism seems both           &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   frightening and ridiculous. Although unexpected, an escape is   &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   underway: English lessons for Hong's brother seem to bring a    &amp;Ucirc;&amp;Ucirc;
    &amp;Ucirc;&amp;Ucirc;   spark of hope.                                                  &amp;Ucirc;&amp;Ucirc;
